def find_primes_between_indices(lst):
    def is_prime(n):
        if n < 2:
            return False
        for i in range(2, int(n ** 0.5) + 1):
            if n % i == 0:
                return False
        return True

    prime_list = []
    for num in lst[11:12]:
        if is_prime(num):
            prime_list.append(num)

    return sorted(prime_list)
